% test main% show 參數轉成矩陣的結果Parameter.i           =  [2.25, 2.25]/100; Parameter.i_v         =  [2.25, 2.25]/100; Parameter.n           =  [6, 10];Parameter.m           =  [1,2,4,12];Parameter.sex         =  ['m','f'];Parameter.buy_age_max =  [70, 65];Parameter.buy_age_min =  [ 0,  0];Parameter.bp_max      =  90;Parameter.gp_scenario =  1:length(Parameter.n)*length(Parameter.sex); C = parameter2cell(Parameter); %將參數轉為矩陣的型式，讓cellfun做迴圈使用。%display Resultfieldnames(C)fprintf('\t n \n')cell2mat(C.n)fprintf('\t m \n')cell2mat(C.m)fprintf('\t sex \n')cell2mat(C.sex)fprintf('\t buy_age_max \n')cell2mat(C.buy_age_max)fprintf('\t buy_age_min \n')cell2mat(C.buy_age_min)fprintf('\t i \n')cell2mat(C.i)fprintf('\t gp_scenario \n')cell2mat(C.gp_scenario)